import React from 'react';

const Awards = () => {
  return (
    <div className='container mt-5 '>
      <div className='row'>
        <div className='col-6'>
            <img src='media/images/largestBroker.svg'/>
        </div>
        <div className='col-6'>
          <h1></h1>
          <p></p>
        </div>
      </div>
    </div>
  );
}

export default Awards;
